import Nav from "../components/Nav";
import Footer from "../components/Footer";
import styles from "../css/App.module.css";
import cappuccino from "../img/menu-cappuccino.jpg";
import FormOfMenuDetail from "../components/FormOfMenuDetail";
import menuData from "../data/menuData.json";

function MenuDetail() {
  return (
    <div>
      <Nav />
      {menuData.map((data) => {
        return (
          <FormOfMenuDetail
            key={data.idx}
            menuName_ko={menuList.name_ko}
            menuName_en={menuList.name_en}
            menuDesc={menuList.desc}
            열량={menuList.열량}
            나트륨={menuList.나트륨}
            포화지방={menuList.포화지방}
            단백질={menuList.단백질}
            당류={menuList.당류}
            카페인={menuList.카페인}
          />
        );
      })}
      <Footer />
    </div>
  );
}

export default MenuDetail;
